$.fn.volumeSlider=function(){$(this).empty();var d=document.createElement("div");$(d).addClass("slider-wrapper");$(this).append(d);var e=document.createElement("div");$(e).addClass("slider-container");$(d).append(e);var c=document.createElement("div");$(c).addClass("slider-range");var b=document.createElement("div");$(b).addClass("slider-loaded").css("width","50%");$(e).append(c);$(e).append(b);var a=document.createElement("span");$(a).addClass("slider-handler").css("left","50%");$(e).append(a)};
